INSERT INTO `kasdeutsch_bot_botcontent` VALUES (1,'О конкурсе','ИДЕТ ПРОВЕРКА БОТА Внимание! В систему голосования внесены изменения. Будут учитываться мнения только тех, кто имеет отношение к самоорганизации и действительно может оценивать активность кандидатов.','Здравствуйте, на данный момент голосование завершено. Следите за результатами конкурса на сайте wiedergeburt.kz и в соцсетях \"Немцы Казахстана\"!','Ваш голос уже был учтён!','Обновить ⊕','Назад','avangard-2023-end_E6cz8Tb.jpg','голоса(-ов)','голоса(-ов), включая ваш','ИДЕТ ПРОВЕРКА БОТА Внимание! В систему голосования внесены изменения. Будут учитываться мнения только тех, кто имеет отношение к самоорганизации и действительно может оценивать активность кандидатов.','Пожалуйста, обновите информацию о конкурсе!','Я голосую!','Ваш голос учтен','demo_upd_bot.jpg','Ваш голос уже учтен','demo_user_bot.jpg','след. фото >','< пред. фото','Скрыть биографию','Читать биографию','Нажимая на кнопку \"Поделиться контактом\", Вы соглашаетесь с передачей Ваших контактных данных. Данная процедура необходима для минимизации привлечения сторонних сервисов и возможности обратной связи с организаторами.','Поделиться контактом','Благодарим за участие, Ваш голос учтен!','Благодарим за участие, Ваш голос учтен!');
