INSERT INTO `kasdeutsch_bot_competition` VALUES (13,'Конкурс «Авангард немцев Казахстана»',0,'Общественный фонд «Казахстанское объединение немцев «Возрождение» объявляет о проведении конкурса «Авангард немцев Казахстана - 2022». Его цель – выявить самых ярких представителей нашего этноса и рассказать о них широкой общественности. Видные учёные, предприниматели, государственные и общественные деятели, люди искусства... На протяжении многих лет они вносили и продолжают вносить значимый вклад в развитие нашей республики, и вписать их славные имена в летопись истории – задача нашей организации.\r\n\r\nПодробности ищите по ссылке: http://wiedergeburt-kasachstan.de/vnimanie-startuet-konkurs-avangard-nemtsev-kazahstana-2022/','avangard-2022.jpg','avangard-partner_2022.jpg',0,0),(14,'Авангард немцев Казахстана – 2022',0,'Общественный фонд «Казахстанское объединение немцев «Возрождение» проводит конкурс «Авангард немцев Казахстана - 2022». Его цель – выявить самых ярких представителей нашего этноса и рассказать о них широкой общественности. Видные учёные, предприниматели, государственные и общественные деятели, люди искусства... На протяжении многих лет они вносили и продолжают вносить значимый вклад в развитие нашей республики, и вписать их славные имена в летопись истории – задача нашей организации.\r\n\r\nС правилами голосования Вы можете ознакомиться по ссылке: http://wiedergeburt-kasachstan.de/konkurs-avangard-nemtsev-kazahstana-2022-pravila-golosovaniya/','avangard-2022_Gv2TyTA.jpg','avangard-partner_2022_XgxnqXv.jpg',0,0),(15,'Самый активный студент Авангарда-2022',0,'Союз немецкой молодёжи Казахстана проводит конкурс «Самый активный студент Авангарда - 2022». Его цель — выявление и поощрение студентов, наиболее активно проявивших себя в учёбе и общественной деятельности.\r\n\r\nС правилами голосования Вы можете ознакомиться по ссылке: http://wiedergeburt-kasachstan.de/konkurs-samyj-aktivnyj-student-avangarda-2022-pravila-golosovaniya/','avangard-SNMK-2022_rF4gAtC.jpg','avangard-SNMK-2022-partner.jpg',0,0),(16,'В кадре: немецкая архитектура',0,'Республиканский конкурс «В кадре: немецкая архитектура» принял 17 фото- и видеоработ по историческим объектам, сохранившимся на территории Республики Казахстан. \r\nКонкурсное жюри в составе которого заслуженные историки, архитектор и инженер-строитель, отобрало на открытое голосование 4 лучших материала. \r\nПоддержите участников, отдав свой голос за лучшую работу!\r\nОрганизатор: Общественный фонд «Казахстанское объединение немцев «Возрождение» при поддержке республиканской немецкой газеты „Deutsche Allgemeine Zeitung“.','Nemetskaya_arhitektura_1_mjDvE8q.jpg','Nemetskaya_arhitektura_priz.jpg',0,0),(17,'Авангард немцев Казахстана – 2023',0,'Ежегодный конкурс проводится по инициативе Общественного фонда «Казахстанское объединение немцев «Возрождение» среди немцев, проживающих в Казахстане.\r\n\r\nЦель конкурса: выявление и стимулирование казахстанских немцев, добившихся общепризнанных успехов в области науки, искусства, образования, медицины, спорта и общественной деятельности.\r\n\r\nДорогие друзья! Пожалуйста, голосуйте в каждой представленной номинации! Сервис не учитывает голоса, отданные только за одного кандидата.\r\n\r\nС правилами голосования Вы можете ознакомиться по ссылке: http://wiedergeburt-kasachstan.de/konkurs-avangard-nemtsev-kazahstana-2023-pravila-golosovaniya/','konkurs-avangard-2023-warning.jpg','konkurs-avangard-2023-warning_llSw8dp.jpg',1,0),(18,'Самый активный студент Авангарда - 2023',0,'Союз немецкой молодёжи Казахстана проводит конкурс «Самый активный студент Авангарда - 2023». Его цель — выявление и поощрение студентов, наиболее активно проявивших себя в учёбе и общественной деятельности.\r\n\r\nС правилами голосования Вы можете ознакомиться по ссылке: http://wiedergeburt-kasachstan.de/konkurs-samyj-aktivnyj-student-avangarda-2023-pravila-golosovaniya/','avangardist-2023.jpg','organisatoren.jpg',0,1),(19,'2024 проверка бота',1,'Добрый день, данные, которые Вы видите, установлен для проверки работоспособности Телеграм-бота','of-2020.jpg','of-2020_0ZRZeN5.jpg',1,1);
