INSERT INTO `kasdeutsch_bot_model` VALUES (44,'Казахстанский переводчик, писатель-прозаик, публицист, литературовед родился 28 октября 1934 года в г. Энгельс. Умер 7 февраля 2015 года. Переводчик классиков казахской литературы (Майлина, Мусрепова, Нурпеисова и др.) на русский язык, автор многочисленных романов, повестей и литературно-критических работ, в центре которых исторический путь и современное положение советских немцев и их национальной литературы. Лауреат Президентской премии мира и духовного согласия (1992). Герольд Бельгер свободно владел казахским языком, работая в сфере трёх культур — казахской, русской и немецкой. \r\nПодробнее читайте по ссылке: http://wiedergeburt-kasachstan.de/book/gerold-belger-takaya-vypala-stezya/','Герольд','Карлович','2021 Бельгер'),(45,'Директор и владелец завода гипсовой лепнины «Dekorgips» родился 13 сентября 1972 г. Проживает в г. Нур-Султан (РК). Активист общества немцев «Возрождение» г. Астана и Акмолинской области, оказывает финансовую поддержку Республиканской немецкой газете «Deutsche Allgemeine Zeitung», а также мероприятиям, проводимым обществом, Ассамблеей народа Казахстана и акиматом г. Нур-Султан. Оказал финансовую помощь при изготовлении памятной доски Герольду Бельгеру, способствует строительству Казахстанско-Немецкого центра в столице. Имеет Почетные грамоты и благодарственные письма от Ассамблеи народа Казахстана, городского акимата, ОФ и РО «Возрождение». В преддверии Дня Независимости республики вклад Алексея Айриха в укрепление национального единства и общественного согласия, последовательное служение идеалам добра и духовному развитию общества был отмечен Благодарственным письмом Ассамблеи народа Казахстана за подписью Елбасы Нурсултана Назарбаева.','Алексей','Августович','2021 Айрих'),(47,'Родился 1.09.1960 года в с. Валерьяновка Кустанайской обл. Депутат, Председатель Комитета по экономическим реформам и региональному развитию Мажилиса Парламента Республики Казахстан, председатель Попечительского совета Общественного фонда «Казахстанское объединение немцев «Возрождение». \r\nВ послужном списке - аким г. Лисаковск, аким Костанайской обл., аким Акмолинской обл., первый вице-министр индустрии и новых технологий, депутат Мажилиса Парламента РК. \r\nНаграды: большой крест за заслуги (ФРГ), орден \"Достык\" 2 ст., Барыс 3 ст., Парасат, \"Кеншi данкы\" второй степени, медаль \"за вклад в создание Евразийского экономического союза\" 1 ст. \r\nПо его инициативе в г. Нур-Султан построена Лютеранская церковь. Активно борется за сохранение немецкого языка в системе образования. Инициатор открытия КНЦ в г. Нур-Султан.','Альберт','Павлович','2021 Рау'),(48,'Казахстанский фристайлист (могул) родился 8 июня 1986 года в г. Усть-Каменогорск. На международных соревнованиях выступает с 2004 года, с тех пор в активе спортсмена множество достойных побед. Чемпион мира среди юниоров по параллельному могулу в Айроло (2007), несколько золотых и бронзовых медалей на этапах Кубка Европы (2008), бронза и серебро в могуле на этапе Кубка мира (2010), Победа на зимней Азиаде-2011 в Алматы, серебро Кубка мира в Китае (2012), на зимней Универсиаде - 2015, золото в параллельном могуле Универсиады-2017 (Алматы); серебро - в рамках первого этапа Кубка мира Рука (Финляндия); серебро Кубка мира по могулу (Китай), 2018 год – серебро Кубка мира в Калгари (Канада); бронза Кубка мира по фристайлу Тазавако (Япония); второе место в общем зачете Кубка мира в могуле. 2020 год – бронза Кубка Мира в Калгари (Канада); бронза Международного турнира FIS Open в Идре (Швеция).','Дмитрий','Александрович','2021 Рейхерд'),(49,'Родилась 16.10.1994 в г. Петропавловск. Мастер спорта международного класса, неоднократная рекордсменка и чемпионка Казахстана в плавании на спине, двукратный серебряный призёр Азиатских игр 2014 Корея, неоднократная чемпионка и рекордсменка возрастных чемпионатов Азии, участница Олимпийских игр Пекин-2008, Лондон-2012, Рио-2016.','Екатерина',NULL,'2021 Руденко (Вышегородцева)'),(50,'Родилась 20.04.1975 в г. Алматы. Заслуженный деятель Республики Казахстан, мастер спорта СССР по художественной гимнастике, член молодежной сборной Советского Союза, неоднократная чемпионка Казахстана. С середины 90-х годов и по сей день со своей группой Fertrauen активно участвует в жизни немецкого этноса. Основательница труппы современного танца «Самрук». Неоднократно представляла «Дни культуры Республики Казахстан» на международном и республиканском уровне, готовила постановку концертных номеров ко Дню города Астаны в 2011 году и к 1000-летию Алматы в 2016 году.\r\nПремия Фонда Первого Президента Республики Казахстан – Елбасы в области культуры и искусства (2010), две первые премии «DanceGames» в Турине (2011), участница «IDO World Championchip Showdance» в Германии, в 2012 году занимает 4 место среди 20 стран в Чемпионате Мира по танцам (Германия), в 2014 - серебряный призер Чемпионата Мира по танцевальному спорту в Праге (Чехия); с 2017 по 2018 гг. работала в цирке duSoleil.','Елена','Давыдовна','2021 Эзау'),(51,'Родилась 04.02.2004 в г. Экибастуз Павлодарской области, занимается музыкой с 6 лет (фортепиано). Нелли является неоднократным лауреатом и дипломантом областных, республиканских и международных конкурсов и фестивалей, многократный обладатель Гран-при конкурсов молодых исполнителей как в Казахстане, так и за рубежом (есть подтверждения в виде отсканированных грамот и дипломов). В 2020 году победила в проекте «ТОП-100 лучших студентов среди учащихся колледжей РК», организованном Министерством образования и науки РК. Принимает активное участие в концертной деятельности.','Нелли','Викторовна','2021 Рерих'),(52,'Член попечительского совета Общественного Фонда КОН \"Возрождение\", Директор НУ «Медицинский Центр «Нур-Авиценум», врач-кардиолог высшей категории, кандидат медицинских наук, независимый медицинский эксперт, родился 5 июля 1947 г.р. в г.Ленинск-Кузнецк Кемеровской области. Сегодня Владимир Антонович - Президент Талдыкорганской Региональной Кардиологической Ассоциации, руководитель секции медико-биологических наук Научного общества немцев Казахстана. Имеет за плечами более 50 печатных работ, защиту кандидатской диссертации и более 10 реализованных проектов с международным участием (в т.ч. инновационный в Казахстане проект по организации центра экстракорпоральной терапии).','Владимир','Антонович','2021 Крайсман'),(53,'Заслуженный врач РК, главный консультант по хирургическим вопросам отделения общей хирургии родился 14 июня 1941г. в селе Грюнфельд Акстафинского района (Азербайджан). С 1978 г. до самой пенсии он проработал врачом в железнодорожной больнице, после выхода на пенсию в 2004 г. продолжает практику и хирургические консультации. В 1991 г. был доверенным лицом Президента РК Н.А.Назарбаева на первых всенародных выборах Президента Республики Казахстан. Являлся депутатом Верховного Совета КазССР XII созыва\r\n- депутат нескольких созывов Советского района и двух созывов городского Совета народных депутатов г.Целиноград, городского созыва КазССР (трех созывов). Член правления общества немцев «Возрождение» г. Астаны и Акмолинской области, в 1998 году открыл Станцию социальной помощи для лиц немецкой национальности. Обладатель 15 государственных наград, в числе которых Орден «Курмет» и «Знак почета», «Отличник здравоохранения РК», «Почетный железнодорожник», «Почетный житель г. Нур-Султан».','Владимир','Альбертович','2021 Баумейстер'),(54,'Археолог, специалист в области изучения памятников каменного века на территории Северного Казахстана родился в 1947 г. в с. Николаевка Есильского района Северо-Казахстанской области. Постоянный и активный член Научного объединения немцев Казахстана (НОНК), отвечал за историческое направление. Активно поддерживал молодых учёных-немцев, в 2008-2012 гг. принимал участие в создании и поддержке Молодежного крыла НОНК. Доктор исторических наук (1992), профессор археологии (1996), член-корреспондент Германского археологического института (1997) и Академии социальных наук Республики Казахстан, член ученого совета по археологии и истории института истории, археологии и этнографии МОН РК (с 1997), автор нескольких научных открытий, в т.ч. одного из сенсационных археологических открытий ХХ века – Ботайской культуры, и более 100 книг и статей по древней истории Северного Казахстана. Профессор Зайберт известен далеко за пределами Казахстана, читал лекции в университетах Оксфорда и Эдинбурга.','Виктор','Фёдорович','2021 Зайберт'),(55,'Кандидат экономических наук, предприниматель, учредитель и генеральный директор международного производственного Консорциума GRP Group (горнодобывающая отрасль). Более 15 лет оказывает финансовую поддержку в деятельности Жезказганского городского общества немцев «Возрождение», содействует в трудоустройстве граждан немецкой национальности. По данным Международной рейтинговой ассоциации г. Гонконг - Топ-менеджер-2018; Мировой лидер в сфере бизнеса за успешную лидерскую и инновационную деятельность – 2019, г.Хьюстон, Техас, «World Confederation Businesses»; Лидер отрасли – 2020. Имеет награды за эффективную деятельность, вклад в устойчивое развитие предпринимательства и экономики Казахстана, за «Вклад в государственный бюджет» (Национальный оргкомитет бизнес-рейтинга в Республике Казахстан).','Владимир','Владимирович','2021 Подлих'),(56,'Выпускница Немецкой театральной академии, окончила магистратуру по специальности режиссер драматического театра. \r\nС 1994 до 2009 год работала в Немецком театре актрисой, затем преподавала в Казахской Национальной академии искусств им. Т.Жургенова на факультете театрального искусства немецкого отделения. В 2015 году возглавила Государственный республиканский академический немецкий драматический театр, став его главным режиссером и идейным вдохновителем. Театр получил новое развитие, объединяя и развивая традиции и ценности театра немцев Советского Союза и современные тенденции. \r\nНаряду со своей основной деятельностью театр не остается в стороне от жизни сообщества немцев Казахстана. Он выступал инициатором и организатором немецких молодежных театральных фестивалей, в том числе в сотрудничестве с Гете-институтом Казахстан,  участвовал в организации и проведении Республиканских фестивалей немецкой культуры, проводимых Ассоциацией общественных объединений немцев Казахстана «Возрождение».','Наташа',NULL,'2021 Дубс'),(58,'Директор НУ «Медицинский Центр «Нур-Авиценум», врач-кардиолог высшей категории, кандидат медицинских наук, независимый медицинский эксперт, Президент и инициатор Талдыкорганской Региональной Кардиологической Ассоциации.\r\nИмеет за плечами более 50 печатных работ, защиту кандидатской диссертации и более 10 реализованных проектов с международным участием (в т.ч. инновационный в Казахстане проект по организации центра экстракорпоральной терапии). Под его руководством освоены современные медицинские технологии, передовые методы лечения, открыт Центр диабета Алматинской области с функциями организационно-методического центра по проблеме диабета и внедрением последних достижений в клиническую практику.\r\nИмеет правительственные награды: медали «Шапағат» и «Бірлік», отмечен Почетной Грамотой Министерства здравоохранения Республики Казахстан, грамотами Акима Алматинской области и маслихата.','Владимир','Антонович','Крайсман'),(59,'Референт Римско-католического прихода Пресвятой Девы Марии Св. Розария Усть-Каменогорска. В 1996 г. с отличием закончила магистратуру. Одна из инициаторов создания Союза немецкой молодёжи Казахстана, председатель молодёжного клуба Немецкого культурного центра ВКО (1995-2004).\r\nПринимала участие в более чем 50 международных научных конференциях. Находится в тесном сотрудничестве с Международным Союзом немецкой культуры (г. Москва), ОФ «Казахстанское объединение немцев «Возрождение», Historischer Vorschungsverein der Deutschen aus Russland e.V. и др.\r\nОбласть научных интересов: история немцев и Католической Церкви в Казахстане. Член научно-исследовательского и общественно-политического общества МАИИКРН. Издала 6 монографий и более 80 научных статей на русском и немецком языках, в том числе коллективную монографию. Её труды посвящены немцам Казахстана и ВКО, истории их поселений и депортации, культуре; истории католической веры и Церкви, религиозным группам и миграционным процессам.','Людмила','Александровна','Бургарт'),(60,'С 1982 года является директором ТОО «Фрунзенское» — многоотраслевого хозяйства по выращиванию и реализации сельскохозяйственной продукции. Председатель совета директоров Денисовского района, член партии «Аманат», избирался депутатом маслихата Костанайской области. 30 лет является активным членом ОО «Костанайский немецкий культурный центр «Возрождение», всегда поддерживает социальные проекты, оказывает спонсорскую помощь.\r\nБлагодаря его поддержке в районе и области успешно реализуется ряд социально-значимых проектов, газифицированы села округа, построен стадион, объекты бытового обслуживания, оказывает финансовую помощь мечети и церкви Красноармейского сельского округа, пожилым людям.\r\nЗа 50 лет трудовой деятельности Николай Николаевич удостоен множества почетных грамот. Награжден юбилейными медалями: 30 лет Целины, Почетной грамотой Президента Республики Казахстан, Орденом Кұрмет и Парасат. Удостоен званий «Почетный гражданин Денисовского района» и «Почетный гражданин Казахстана».','Николай','Николаевич','Шерер'),(61,'Председатель Павлодарского общества немцев «Возрождение», учредитель ТОО «РубиКОМ», меценат. Внёс значительный вклад в сохранение, пропаганду и развитие культуры и языка немцев Павлодарского Прииртышья, в объединение и консолидацию немецкого этноса области и республики.\r\nВ 2017 году, учитывая активную жизненную позицию, участие как спонсора и мецената немецкого общественного движения, В.Руфа избрали председателем Совета учредителей ОФ КОН «Возрождение».\r\nВ 2021 году Вячеслав Андреевич обеспечил софинансирование проекта по приобретению здания для общества немцев в г. Павлодар. Это было обязательным условием МВД Германии. Благодаря этому у немцев Павлодарского Прииртышья появилась уникальная возможность – сохранять родную идентичность и язык в стенах собственного дома.\r\nИмеет ряд наград — медали «Ерен енбегi iшiн», 20 лет независимости РК, 20 лет Ассамблеи РК, 25 лет Ассамблеи народа РК, 30 лет Независимости РК. Звания: «Благотворитель года» (2006), «Білім меценаты» (2012).','Вячеслав','Андреевич','Руф'),(63,'Живописец-пейзажист, мастер портрета и натюрморта. Член Союза художников и Академии Художеств Казахстана, творческого объединения Крыма и других объединений. Доцент кафедры «Архитектура» Агротехнического университета им. С. Сейфуллина.\r\nБольшинство работ мастера посвящены родному краю, художник создаёт пейзажи столицы – современной, многоэтажной, а также старого Целинограда. Виктор Кель участник множества республиканских, международных и персональных выставок. Известен в Казахстане и других странах.\r\nИмеет ряд наград. В частности, диплом Союза художников Казахстана за лучшую творческую работу, благодарственное письмо за значительный вклад в изобразительное искусство Казахстана, благодарственное письмо за высокие показатели в творческой подготовке студентов и профессиональное мастерство, благодарственное письмо за проведение персональной выставки живописи «Души прекрасные порывы» от руководства Российского сотрудничества в РК, медаль к 55-летию КазАТУ им. С.Сейфуллина.','Виктор','Матвеевич','Кель'),(66,'Казахстанский спортсмен-паралимпиец, соревнующийся в биатлоне и лыжных гонках. Бронзовый призёр зимних Паралимпийских игр 2022 года в Пекине.\r\nОкончил Северо-Казахстанский государственный университет имени М.Козыбаева, активно занимался спортом. В 2011 году попал в ДТП, получил инвалидность 3 группы. После просмотра зимних Паралимпийских игр в Сочи решил попробовать себя в паралимпийском спорте, и с 2014 года занялся лыжными гонками под руководством Ивана и Марии Дробязко в Петропавловске и в клубе «Умит».\r\nСпортсмен настойчиво и упорно тренируется по 7-8 часов в день, преодолевая свои страхи и самого себя, регулярно участвует в спортивных состязаниях, завоёвывая призовые места.\r\nНа зимней Паралимпиаде 2018 года в Пхёнчхане добился самого высокого результата Казахстана, которые демонстрировались на играх с 1994 года - занял четвёртое место в гонке свободным стилем стоя. Но настоящим успехом стала бронзовая медаль в Пекине.\r\nНаграждён высокой государственной наградой — орденом «Курмет».','Александр','Александрович','Герлиц'),(69,'Профессиональный медиатор, юрист, председатель палаты РОО «Республиканская Палата профессиональных медиаторов». Член рабочей группы по проекту Закона «О внесении изменений и дополнений в некоторые законодательные акты по вопросам развития институтов внесудебного урегулирования споров».\r\nТренер-медиатор курсов повышения квалификации для судей, адвокатов, юристов, специалистов по корпоративно-правовой работе, а также по специально разработанным учебным программам в ОФ «Возрождение». Постоянный член Бизнес-клуба немцев Казахстана. Закончила Павлодарский государственный университет им.Торайгырова по специальности «юриспруденция», успешно прошла обучение по ряду программ с присвоением квалификации «Профессиональный медиатор» и «Тренер медиатор».\r\nИмеет благодарственные письма областного Суда г.Павлодар, НПО, КГУ «Қоғамдық келісім», от Деловых женщин России за вклад в содружество между странами и Международного журнала «Вестник медиации в ЕврАзии» за вклад в развитие и продвижение медиации.','Ольга','Владимировна','Эрлих'),(70,'Лауреат Республиканских и Международных конкурсов исполнителей, стипендиатка Фонда Первого Президента Республики Казахстан (с 2021 г.).\r\nПринимает активное участие в концертно-исполнительской, учебной и общественной деятельности. В 2021 г. стала Лауреатом премии Акима Павлодарской области «Тәуелсіздік ұланы».\r\nВ 2020 году победила в проекте «ТОП-100 лучших студентов среди учащихся колледжей Республики Казахстан», организованном Министерством образования и науки РК; а в 2019 году стала самым юным Лауреатом премии Акима Павлодарской области «ERTIS DARYNY – 2019» в номинации «Культура».','Нелли','Викторовна','Рерих'),(71,'Солистка Шымкентского городского театра оперы и балета, окончила Шымкентский институт культуры, магистратуру и аспирантуру Магнитогорской Государственной консерватории им. М. И. Глинки.\r\nАктивна в общественной жизни, руководит вокальными кружками при региональном обществе немцев г. Шымкент. Неоднократно принимала участие в республиканских и областных фестивалях немецкой культуры, проявляя большой талант в исполнении немецкой музыки. Лауреат международных вокальных конкурсов: I премии конкурса «Rübezahl Musikalischer Garten» (Польша); III премии конкурса «DocStar» (Караганда), I премии конкурса «Баховская весна» (Магнитогорск), II премии конкурса вокалистов им. Натальи Шпиллер «Шедевры русской музыки» (Москва).\r\nМаргарита Кин активно использует свой профессиональный опыт для изучения и популяризации немецкой классической, народной и эстрадной музыки, исполняя произведения немецких композиторов и народные песни немцев Казахстана и России.','Маргарита','Вячеславовна','Кин'),(72,'Многократный чемпион молодёжных чемпионатов республики Казахстан, призёр взрослого ЧРК, чемпион XIX Всемирной гимназиады во Франции, Дмитрий Энес входит в негласный список самых перспективных юных пловцов Казахстана.\r\nНа международном первенстве во Франции — XIX Всемирной гимназиаде-2022 — 15-летний школьник показал достойный результат, завоевал золотую медаль и признание в профессиональном сообществе. Он стал чемпионом в заплыве баттерфляем на дистанции 50 метров, обойдя соперников из Венгрии и Украины.\r\nВ карьере юного дарования это не первая победа — Дмитрий занимается плаванием с ранних лет и регулярно участвует в различных соревнованиях.','Дмитрий','Максимович','Энес'),(73,'Руководитель швейной компании «Angelcher» более 15 лет специализируется на пошиве школьной формы и мужских костюмов. За эти годы «Angelcher» из ателье в Алматы выросла до предприятия, имеющего собственный цех по пошиву одежды и сеть фирменных магазинов по всему Казахстану.\r\nЕжегодно участвует в форумах-выставках по школьной форме и выставках отечественных товаропроизводителей. Продукция компании «Angelcher» из года в год получает самые тёплые отзывы от своих покупателей. Бренд занял 1 место в конкурсе-выставке «Лучший товар Казахстана» (2012, 2017).\r\nАктивен в общественной жизни немцев г. Алматы и области — участие в городских мероприятиях (представление немецкого этноса на городских площадках), участие в социально значимых, культурных и молодёжных проектах. Регулярно оказывает спонсорскую помощь — ремонт мебели, предоставление транспорта и помещений на проекты, в частности, проведения Рождественских и других значимых мероприятий, связанных с культурой этнических немцев.','Евгений','Михайлович','Ангельхер'),(74,'Учёный-сельскохозяйственник, общественный деятель, доктор сельскохозяйственных наук, профессор, Академик Национальной академии наук РК. Лауреат Ленинской премии (1972) как один из разработчиков системы защиты почв от ветровой эрозии. В 1991 г. защитил докторскую диссертацию по теме «Научное обоснование приемов защиты почв от дефляции в степной зоне Азиатского региона».\r\nСвои научные достижения Эрвин Госсен изложил в более 200 научных статей, в том числе и в иностранных изданиях. Большая часть из них посвящена почвозащитному земледелию, где представлены результаты лабораторных и полевых опытов. Они позволили обосновать устойчивость основных типов почв Казахстана к ветру на различных агротехнических фонах.\r\nИмеет ряд высоких государственных наград: медаль «За освоение целинных и залежных земель»; Золотая и бронзовая медали ВДНХ СССР; Золотая медаль и звание Лауреата Ленинской премии; орден «Знак Почета»; орден Трудового Красного знамени; медаль «Ветеран труда»; ордена «Достық» и «Отан».','Эрвин','Францевич','Госсен'),(75,'Учится на преподавателя иностранных языков (английского и немецкого). \r\nВ марте 2022 года Екатерина стала заместителем лидера КНМ Grashüpfer г. Караганда, в то же время являлась руководителем кружка Basteln и координатором по молодежной работе. Этим летом работала вожатой в лингвистическом лагере от школы Erfolg. Сейчас продолжает работать там воспитателем 1-го класса. Вместе с лидером клуба обновляет и улучшает Instagram клуба. Координирует работу созданной группы и корректирует посты. \r\nВ этом году Екатерина посетила два очных проекта – Tandem и Совет СНМК.\r\nПринимала участие в языковой академии Mach mit и проходила обучение в DiShule. В течение года участвовала практически во всех встречах КНМ.','Екатерина',NULL,'Фафинрод'),(76,'Учится на 5 курсе медицинского университета и является координатором по молодёжной работе в РО г. Караганда.\r\nРегина - перфекционист и ценитель прекрасного, любит порядок в быту и в отношениях. Переезд и организация работы в новом здании – сложный процесс, с которым она успешно справилась. Наладила и систематизировала работу клуба, сделала жизнь в клубе более увлекательной, атмосферу более дружеской, деятельность более современной и интересной. Написала проект по немецкой свадьбе, наполненной множеством мастер-классов, с организацией и проведением самого торжества. \r\nПод руководством Регины молодёжь самостоятельно организовала и провела праздник Erntedankfest. Оформили залы, кабинеты, заранее собрали гербарий, придумали программу, подготовили театральную постановку и получили в подарок огромную тыкву! \r\nПосле прослушивания вебинаров в проекте «Мой немецкий костюм» самостоятельно разработала эскиз национального костюма.','Регина',NULL,'Терёшкина'),(77,'Cтудентка 3 курса университета им. Шокана Уалиханова (факультет Высшей школы медицины). Виктория - участница КНМ Zodiak РО Кокшетау. \r\nНеоднократно участвовала в волонтерской деятельности; изучала немецкий язык через спортивные мероприятия Sport ist Gesund; посещала тренинги от Мобильных групп СНМК; была участницей крупных мероприятий  Ostern, Walpurgisnacht, Pfingsten, Johanistag, Erntedankfest, Trauertag. \r\nПосещает курсы немецкого языка и уроки Landeskunde; принимает участие в тимбилдингах; в организации Хэллоуина. Подавала работу на конкурс Kaleidoskop der Geschichte. \r\nС удовольствием посещает тренинги лидерства при КНМ, на которых молодёжь создаёт и воплощает идеи для улучшения и продвижения клуба.','Виктория',NULL,'Скворцова'),(78,'Студент 2-го курса Казахстанско-Немецкого университета. Активист клуба немецкой молодежи Vorwärts и РО «Возрождение» г. Алматы. \r\nСайрэс принимает участие во всех мероприятиях РО, помогает с организацией и проведением. Посещает различные мастер-классы, лекции по истории и семинары. \r\nСамым важным мероприятием этого года он считает продуктовую помощь сеньорам. Регулярно проявляет себя в проекте «Поздравление юбиляров» и поддерживает очень тёплые отношения с трудармейцами. Прошедшим летом стал участником двух языковых лагерей. Ездил в языковой лагерь в Германию и в Боровое, где повысил свой уровень немецкого языка, узнал больше о немецкой культуре, познакомился с интересными людьми. Мультиплицировал полученные знания в КНМ. \r\nПринимал участие в дне памяти Герольду Бельгеру, ездил с танцевальной группой A-Tanzen в г. Есик, где проводился  ряд культурных и просветительских мероприятий с целью популяризации  деятельности общества и привлечения новых участников из немецкого этноса региона.','Сайрэс',NULL,'Маркштедер'),(79,'Учится в ЕНУ им. Л.Н. Гумилева по специальности PR. \r\nЗа год Юнна стала одним из самых активных участников и заместителем лидера клуба немецкой молодежи Diamant (г. Астана). Деятельность в клубе начинала с вокальной и театральной студий. Выступала в постановке ко Дню памяти Анны Герман. \r\nУчаствовала в проекте MachMit, прошла интенсив по изучению языка. Считает, что толчком в её развитии стал лагерь Borlin-Jugendtreff - 2022. С октября работает в проекте Сеть центров встреч. Специализируется на театре и музыке. Принимала участие на Совете СНМК и почувствовала, что это именно то, что нужно. Пишет статьи в DAZ. Недавно стала помощником SMM-редактора в КНМ. Юнна владеет немецким языком на уровне С1.','Юнна',NULL,'Кинерейш'),(80,'Cтудент 4-го курса университета им. Ш. Уалиханова (Кокшетау). Эдуард учится на преподавателя немецкого языка. Активист и заместитель лидера молодежи в клубе Zodiak г. Кокшетау. \r\nВ КНМ уже 4 года. Всегда помогает в организации мероприятий в своем Клубе и региональном обществе. В 2022 году принял участие в молодежном лагере Jugentreff (Borlin), а также на семинаре JEV (Jugend Eropalscher Volksgruppen) в Румынии. Владеет немецким языком на уровне В2.','Эдуард',NULL,'Дановец'),(81,'Студентка 1-го курса Казахстанско-Немецкого университета, Афина изучает специальность «Энергетическая и экологическая техника».\r\nВ молодежном движении с 2019 года. С сентября 2022-го является лидером КНМ Vorwärts в г. Алматы. Афина любит учиться, взаимодействовать с людьми и развиваться. Регулярно организует мероприятия в клубе и региональном обществе. \r\nПодготовила проект Familienküche, на котором познакомила молодежь с блюдами этнических немцев. Мультиплицирует знания, полученные на Совете СНМК. Заняла 2-е место в конкурсе газеты DAZ по казахскому языку. Помогала в организации и проведении мероприятия для детей в Воскресной школе к празднику Martinstag.\r\nУчаствовала в тренингах по командообразованию, посещала лекции по истории немцев, помогала в организации мероприятия, посвященном памяти Герольда Бельгера. \r\nРада, что “Авангард” дает возможность молодёжи получать квалифицированное образование и проявлять себя в общественной деятельности.','Афина',NULL,'Гейнерт'),(84,'Архитектурный объект: Церковно-приходской комплекс Римско-католического прихода Пресвятой Девы Марии Святого Розария г. Усть-Каменогорска.\r\nВключает в себя здание часовни, приходские дома, въездную арку и каменный Грот Пресвятой Богородицы.\r\nОбъект является частью культурного наследия Католической Церкви и немцев-католиков в Казахстане. Он привлекает внимание жителей, туристов, гостей города и нередко называется «маленькой Европой», став одной из достопримечательностей Усть-Каменогорска.','Людмила',', Усть-Каменогорск','Бургарт'),(85,'Архитектурные объекты: гостиница \"Ливадия\", построенная Иоанном Шмидтом (1905), немецкая мельница Иоанна Тиссена (1910)\r\nГостиница «Ливадия» – это образец каменно-деревянного зодчества конца XIX – начала XX вв.  В свое время в одной из первых гостиниц Павлодара останавливались известные люди, например, писатель Михаил Пришвин.\r\nСледующая достопримечательность - бывшая вальцевая автоматическая крупчатная мельница, построенная в 1910 году хортицким меннонитом, немцем Иоанном Тиссеном. При советской власти мельница превратилась в мелькомбинат и просуществовала до конца 1970-х, а затем была заброшена.\r\nВ этих уникальных зданиях можно было бы разместить музеи, в том числе промышленной истории, организовать там прекрасные места для арт-площадок, выставок, встреч молодёжи, людей искусства и культуры.\r\nВидео смотрите по ссылке: https://youtu.be/1kc0h_iNgMs','Злата',', Павлодар','Кондрашова'),(86,'Архитектурные объекты: историко-краеведческий музей, спроектированный в XIX веке Э.Х. Корфом и Аптека Штрауса (XIX в.)\r\nИсследование смотрите по ссылке: https://youtu.be/881S2Cat5OI','немецкого общества',', Уральск','Молодежь и подростки'),(87,'Архитектурный объект: пивоваренный завод купца Антона Лореца — памятник промышленной архитектуры XIX-XX веков. Здание построено из жженого кирпича. Два основных корпуса выходят фасадами на улицу Каирбекова и представляют собой сплошную фронтальную застройку. На стене завода имеется надпись – 1907 год, выполненная из фасонного кирпича. В подвалах сохранились чаны для варки пива, устроенные ещё А.П. Лорецом. В цехах – полы, потолки и стены облицованы материалами с функциональным назначением цеха и санитарными нормами. \r\nКомплекс завода расположен на окраине старой части города с общей территорией около 9,5 га и занимает почти весь квартал.\r\nДетективное расследование смотрите здесь: https://youtu.be/JqMFYS2Mvvw','“Zwiebel”',', Костанай','Команда клуба немецкой молодежи'),(98,'Директор Центра семейного здоровья ТОО «Тильман» (семейная врачебная амбулатория «Тильман»), врач общей практики I квалификационной категории, Отличник здравоохранения РК.\r\nС 1995 г. ведет оказание медико-социальной и амбулаторной помощи трудармейцам, реабилитированным и гражданам немецкой национальности по договору с Жезказганским городским обществом немцев «Возрождение».\r\nДепутат Жезказганского городского маслихата III созыва, соучредитель и член Ассоциации семейных врачей Казахстана, член Всемирной ассоциации семейных врачей (WONCA), соучредитель и член Национальной ассоциации Primary health care, награжден премией академика Т. Шарманова в номинации «Лучший семейный врач Республики Казахстана».','Виктор','Викторович','Тильман'),(99,'Врач-офтальмохирург высшей квалификационной категории, кандидат медицинских наук. Заместитель директора ТОО «Клиника микрохирургии глаза «Optima» (г.Астана) по клиническим вопросам, вице-президент НПА «Казахстанское общество офтальмологов» по стратегическим вопросам. Председатель филиала НПА «Казахстанское общество офтальмологов» в г.Астана, член Европейского общества катарактальных и рефракционных хирургов (ESCRS). Член Российского общества катарактальных и рефракционных хирургов (RSCRS), Российского глаукомного общества, НПА «Казахстанское общество офтальмологов».\r\nЭксперт международного экспертного совета по Синдрому сухого глаза, Национального центра государственной научно-технической экспертизы, Республиканского центра развития здравоохранения РК, комитета медицинского и фармацевтического контроля Министерства здравоохранения РК по г.Астана.','Константин','Александрович','Урих'),(100,'Художник, главный художник областного драматического театра имени Ф.М. Достоевского, имеет около полутора тысяч работ. Дипломант международного арт-фестиваля «Тенгри-Умай» (Алматы), лауреат международного арт-симпозиума «Великий шелковый путь» (Елабуга).\r\nПерсональные выставки Виктора Шмидта регулярно проходят в музеях Усть-Каменогорска и Семея, он регулярно проводит творческие мастер-классы по изобразительному искусству для воспитанников общественного объединения немцев «Возрождение» г. Семей. В 2022 году принимал участие в ХVII Международном арт-симпозиуме по современному искусству (Елабуга) на тему «Симфония труда», где показал культуру немецкого народа в национальном костюме, а именно: работу кузнеца, гончара и сапожника.','Виктор','Федорович','Шмидт'),(101,'Мастер спорта международного класса по армрестлингу, многократный чемпион Казахстана, двукратный чемпион Азии, призер чемпионата Европы по армрестлингу.','Руслан','Рудольфович','Реннерт'),(102,'Мастер спорта международного класса по спортивной акробатике, завоевал в 2023 году золото Чемпионата мира по спортивной акробатике.\r\nПобедитель кубка мира (2019), чемпион Азии (2019), многократный чемпион РК,  победитель множества международных турниров. Победитель в номинации «Лучший спортсмен» (2017) и лидер среди спортсменов Федерации гимнастики (2018). \r\nЛауреат премии «Дарын» в номинации «Молодой рабочий» (2018), победитель проекта «100 новых лиц Казахстана - 2021». \r\nРаботает на шахте им. Костенко подземным горнорабочим.','Даниэль','Артурович','Диль'),(103,'Руководитель ТОО им. К.Маркса, ученый-агроном, меценат, член областной Ассамблеи народа Казахстана, немецкого бизнес-центра и областной палаты предпринимателей «Атамекен». Стоял у истоков создания движения немцев Казахстана, член Костанайского немецкого центра «Возрождение» и Совета общества. Он бережно собирает историю своего села, которому в этом году исполняется 150 лет, построил музей.\r\nТОО им. К.Маркса – показательное хозяйство, которое постоянно посещают руководители и сотрудники дипломатических миссий ФРГ в РК, международные делегации. Иван Матвеевич уделяет внимание сохранению социальных объектов и их развитию. ТОО - лучшее в области и республике хозяйство со стабильной экономикой и высокой оплатой труда, в нем создана прекрасная инфраструктура. Село ухоженное - традиция сельчан, привитая им их руководителем.\r\nИван Вечтейн - Почетный гражданин Костанайского района Костанайской области, имеет государственные награды: орден «Парасат», медаль «50 лет Целины», орден «Отан».','Иван','Матвеевич','Вечтейн'),(104,'Александр Филиппович более 45 лет проработал в системе санитарно-эпидемиологической службы Казахстана (участвовал в организации и проведении карантинных и противоэпидемических мероприятий в очагах чумы, холеры, сыпного и брюшного тифа, вирусных инфекций на территории Западного Казахстана и ареала Волго-Уральских песков; автор ряда статей и публикаций).\r\n17 лет он посвятил служению своим избирателям в областном маслихате. Депутат четырех созывов, Почетный депутат маслихатов Казахстана, он являлся общественным заместителем акима области в АНК Атырауской области.\r\nКавалер орденов «Достык» и «Курмет», Отличник здравоохранения Республики Казахстан, член Ассамблеи народа Казахстана, советник Ассамблеи народа Казахстана Атырауской области\r\nПочетный председатель и советник Атырауского общества немцев «Видергебурт», активист движения немцев Казахстана, заместитель председателя Ассоциации общественных объединений немцев Казахстана «Возрождение».','Александр','Филиппович','Думлер'),(105,'Генеральный директор управляющей компании «Шанырак», учредитель ТОО «Курочка Ряба» реконструировал начальную школу на 30 мест под основную на 50 в с. Бирлик, внёс значительный финансовый вклад в строительство лютеранского собора в г. Астана. Александр Александрович выделил средства на реконструкцию и благоустройство здания КНЦ в Астане, оказал существенную поддержку конкурсу «Авангард немцев Казахстана», выступил одним из инициаторов и спонсором возведения бюста Ивану Шарфу.\r\nУказом Президента награжден орденом «Достык» II степени за внесение значительного вклада в сохранение взаимного согласия в обществе, в дело дружбы и сотрудничества между народами. Благодаря его инвестициям в Казахстане реанимированы 6 крупных предприятий, которые являются и градообразующими. \r\nАлександр Лоренц активно занимается благотворительностью, вкладывая личные средства в восстановление социальных объектов, объектов инфраструктуры, строительство спортивных и игровых площадок для детей.','Александр','Александрович','Лоренц'),(106,'Видный учёный с мировым именем, доктор физико-математических наук, профессор, академик НАН РК. Свободно владел немецким, казахским и русским языками.\r\nПрошёл все ступени от технического работника до старшего научного сотрудника. Защитил докторскую диссертацию в Объединённом Институте ядерных исследований в г. Дубна. В 1983 г. - член-корреспондент, с 2000 г. - действительный член Национальной Академии наук Казахстана. С 1990 года возглавлял Научное объединение немцев Казахстана.\r\nЭрнст Боос - автор свыше 300 научных статей, в том числе целого ряда монографий. Наряду с фундаментальными исследованиями, он отдал много сил и энергии развитию прикладных работ по использованию нетрадиционных, экологически чистых, возобновляемых источников энергии. Большой вклад Эрнст Боос внес в развитие казахстанского интернета, основав первую казахстанскую научно-образовательную сеть, способствовал укреплению научных связей Казахстана с Германией и другими немецкоязычными странами.','Эрнст','Гербертович','Боос'),(108,'','Test',NULL,NULL),(109,'Студентка Международного университета информационных технологий по специальности  \"Программист\" (ВТИПО). Активистка клуба немецкой молодежи города Алматы с 2018 года. С подросткового возраста активно участвует в республиканских  и международных проектах. В конце прошлого года стала лидером нового молодежного филиала в городе Иссык. \r\nАнгелина очень ответственна и отзывчива. С радостью принимается за решение любого вопроса.','Фаст',NULL,'Ангелина'),(110,'Обучается в Авиационном колледже по специальности \"Инженер в области радионавигации, радиолокации и связи\". Более двух лет является активным авангардистом Алматинского общества “Возрождение”.  Проявляет активность в РО и КНМ. \r\nВсегда отзывчив и коммуникабелен. Выполняет разную работу, начиная от помощи в украшении места проведения праздника до музыкального сопровождения на мероприятиях. Участвует в республиканских проектах СНМК.','Юстус',NULL,'Владимир'),(111,'Студентка НАО Евразийский национальный университет им. Л.Н. Гумилева, факультет журналистики и политологии.\r\nЯвляется лидером клуба немецкой молодежи «Diamant» г. Астаны, заместителем председателя Союза Немецкой Молодежи Казахстана. За 2023 год организовывала воскресные встречи клуба на разные темы. Участвовала в крупных мероприятиях. Была ведущей во время презентации книги детских рассказов Г. Бельгера. \r\nНеоднократно выступала в роли режиссёра, сценариста и постановщика.  Так, организовала постановку ко дню памяти Анны Ахматовой. Была участником, затем сама стала тренером в составе «Мобильной группы». Участвовала в проекте «Erleben@Gestalten@Lernen».','Киреева',NULL,'Анастасия'),(112,'Студент второго курса Кокшетауского университета им. Ш. Уалиханова по специальности «Иностранные языки: немецкий и английский».\r\nАктивный участник КНМ “ZODIAK”. Талантливый, трудолюбивый, изобретательный, всесторонне развитый. Участник театральной студии. Хорошо учится и посещает все мероприятия РО и КНМ. Участвовал в международном театральном немецкоязычном фестивале в Хорватии, где представлял Казахстан на международной сцене.','Болгару',NULL,'Никита'),(113,'Студентка второго курса Кокшетауского университета им. Ш. Уалиханова по специальности «Иностранные языки: немецкий и английский».\r\nЗа два года обучения по проекту \"Поддержка студентов\" программа \"Авангард\" показала себя ответственным, коммуникативным, креативным, надежным членом клуба. \r\nС февраля 2023 года является лидером КНМ «ZODIAК» г. Кокшетау. Постоянно принимает участие во всех мероприятиях, помогает в организации их проведения. На протяжении двух лет является участником театральной студии, где показывает высокое мастерство. На всех этнических праздниках участвует в театральных постановках, выступает с вокальной и танцевальной группой. В июне 2023 года была участником международного театрального немецкоязычного фестиваля в Хорватии. Посещает курсы немецкого языка и имеет отличные результаты учебы в университете. Юлия принимает активное участие в проектах ОФ.','Келлер',NULL,'Юлия'),(114,'Студент 3 курса Колледжа профессионального образования \"ALEM\" по специальности \"Программное обеспечение\", активист клуба немецкой молодёжи „Juwel“ и Общества немцев Жамбылской области, участник проекта «Авангард». \r\nВ обществе уже три года. Регулярно посещает вокальный и инструментальный кружки, изучает немецкий язык, помогает в сборе информации материала и монтаже роликов для кружка “Einblick in die Geschichte” по проекту СЦВ. За 2023 год принимал участие в “Frauentag” и“Ostern”.  \r\nНа областной отчетной конференции был отмечен Благодарственным письмом, выступал на мероприятии, посвященном Дню родного языка, а также принимал активное участие в тематических мастер-классах проводимых в рамках проектов СЦВ и КНМ.','Сливкин',NULL,'Сергей'),(115,'Студентка второго курса Западно-Казахстанского инновационно-технологического университета. Специальность \"Вычислительная техника и информационные системы\". \r\nЯвляется активистом Уральского КНМ, принимает участие во всех проектах и мероприятиях. Посещает кружок игры на гитаре. Хорошо владеет компьютером и предложила вести кружок по ознакомлению ребят с компьютерными программами. Разрабатывает сайт и новый логотип для КНМ, оптимизирует работу СЦВ, СГП, ЦДДО и др. Участвует в онлайн конкурсах от СНМК и РО.','Негреева',NULL,'Екатерина'),(116,'Студент Казахстанско-Немецкого университета по специальности \"Программист\". Уроженец и член клуба немецкой молодежи г. Уральск, в данный момент обучается в Алматы. Здесь он ведет активную деятельность, принимает участие в мероприятиях общества, писал статьи для Портала немцев Казахстана.\r\nАдиль продолжает принимать участие и в жизни родного Уральска. Недавно помогал в проведении информационной лаборатории, где разъяснял ребятам то, как стать участником Авангарда и какие особенности надо знать, как проявлять активность и в каких проектах можно участвовать. \r\nОдна из его идей: поход с клубом по тропам его деда Г.И. Креймера - известного немца Казахстана, заслуженного деятеля, краеведа, историка и педагога.','Мукашев',NULL,'Адиль'),(117,'Данная модель выставлена для проверки работы Телеграм-бота','Проверка модель 3',NULL,'Номинация 2'),(118,'Данная модель выставлена для проверки работы Телеграм-бота','Проверка модель 2',NULL,'Номинация 1'),(119,'Данная модель выставлена для проверки работы Телеграм-бота','Проверка модель 1',NULL,'Номинация 1'),(120,'Данная модель выставлена для проверки работы Телеграм-бота','Проверка модель 4',NULL,'Номинация 2'),(121,'Данная модель выставлена для проверки работы Телеграм-бота','Проверка модель 5',NULL,'Номинация 3'),(122,'Данная модель выставлена для проверки работы Телеграм-бота','Проверка модель 6',NULL,'Номинация 3');
