INSERT INTO `kasdeutsch_bot_nomination` VALUES (19,'2021 Наука','avangard-2021-wissenschaft.jpg',13,'В данную номинацию принимались заявки от известных ученых из различных областей. Конкурсная комиссия отобрала личности, которые уже много лет вносят существенный вклад в развитие нашей республики. Выбирайте и Вы!'),(20,'2021 Искусство','avangard-2021-kultur.jpg',13,'Кандидаты номинации - лица творческих профессий. Выберите одного из представленных номинантов и голосуйте!'),(21,'2021 Спорт','avangard-2021-sport.jpg',13,'Вашему вниманию представлены известные спортсмены международного класса. Выбирайте и голосуйте!'),(22,'2021 Общественная деятельность','avangard-2021-gesellschaft.jpg',13,'Многие представители нашего этноса успешно вносят свой вклад в развитие современного общества. Предлагаем Вам познакомиться с наиболее яркими его представителями.'),(23,'2021 Меценатство','avangard-2021-business.jpg',13,'В этой номинации Вы познакомитесь с предпринимателями, оказывающими регулярную существенную поддержку движению немцев Казахстана как на региональном, так и республиканском уровне.'),(24,'2021 Выдающиеся личности, ушедшие из жизни','avangard-2021-tod.jpg',13,'В данной номинации, посвященной памяти выдающихся личностей, ушедших из жизни, конкурсная комиссия приняла решение о вручении награды родным Эрнста Гербертовича Бооса. Подробнее об известном ученом читайте в описании.'),(41,'2022 Наука','avangard-2022-wissenschaft_qhir8vp.jpg',14,'В данную номинацию принимались заявки от известных ученых из различных областей. Конкурсная комиссия отобрала личности, которые уже много лет вносят существенный вклад в развитие нашей республики. Выбирайте и Вы!'),(42,'2022 Искусство','avangard-2022-kultur_aDDdP3P.jpg',14,'Кандидаты номинации - лица творческих профессий. Выберите одного из представленных номинантов и голосуйте!'),(43,'2022 Спорт','avangard-2022-sport_AE6XKIW.jpg',14,'Вашему вниманию представлены известные спортсмены международного класса. Выбирайте и голосуйте!'),(44,'2022 Общественная деятельность','avangard-2022-gesellschaft_pPfaEbM.jpg',14,'Многие представители нашего этноса успешно вносят свой вклад в развитие современного общества. Предлагаем Вам познакомиться с наиболее яркими его представителями.'),(45,'2022 Меценатство','avangard-2022-business_jjyyu14.jpg',14,'В данной номинации, посвященной предпринимателям, оказывающими регулярную существенную поддержку движению немцев Казахстана как на региональном, так и республиканском уровне конкурсная комиссия приняла решение о вручении награды Вячеславу Андреевичу Руфу. Подробнее о председателе Павлодарского общества немцев «Возрождение», учредителе ТОО «РубиКОМ» и известном меценате читайте в описании.'),(46,'2022 Выдающиеся личности, ушедшие из жизни','avangard-2022-tod_Jth89iU.jpg',14,'В данной номинации, посвященной памяти выдающихся личностей, ушедших из жизни, конкурсная комиссия приняла решение о вручении награды родным Эрвина Францевича Госсена. Подробнее об известном ученом читайте в описании.'),(47,'Номинанты конкурса','avangard-SNMK-2022-kandidaten.jpg',15,'Отдай свой голос за одного из кандидатов!'),(48,'НАШИ НОМИНАНТЫ:','Nemetskaya_arhitektura_nominant.jpg',16,'Вашему вниманию представлены четыре лучшие работы участников республиканского конкурса «В кадре: немецкая архитектура».'),(49,'Наука','2023-wissenschaft-warning.jpg',17,'В данную номинацию принимались заявки от известных ученых из различных областей. Конкурсная комиссия отобрала личности, которые уже много лет вносят существенный вклад в развитие нашей республики. Выбирайте и Вы!\r\n\r\nПожалуйста, голосуйте в каждой представленной номинации! Сервис не учитывает голоса, отданные только за одного кандидата.'),(50,'Искусство','2023-kultur-warning.jpg',17,'Кандидаты номинации - лица творческих профессий. Выберите одного из представленных здесь номинантов!\r\n\r\nПожалуйста, голосуйте в каждой представленной номинации! Сервис не учитывает голоса, отданные только за одного кандидата.'),(51,'Спорт','2023-sport-warning.jpg',17,'Вашему вниманию представлены известные спортсмены международного класса. Выбирайте и голосуйте!\r\n\r\nПожалуйста, голосуйте в каждой представленной номинации! Сервис не учитывает голоса, отданные только за одного кандидата.'),(52,'Общественная деятельность','2023-gesellschaft-warning.jpg',17,'Многие представители нашего этноса успешно вносят свой вклад в развитие современного общества. Предлагаем Вам познакомиться с наиболее яркими его представителями.\r\n\r\nПожалуйста, голосуйте в каждой представленной номинации! Сервис не учитывает голоса, отданные только за одного кандидата.'),(53,'Меценатство','2023-business-warning.jpg',17,'В данной номинации, посвященной предпринимателям, оказывающими регулярную существенную поддержку движению немцев Казахстана как на региональном, так и республиканском уровне конкурсная комиссия приняла решение о вручении награды Александру Лоренцу. Подробнее об известном меценате читайте в описании.\r\n\r\nПожалуйста, голосуйте в каждой представленной номинации! Сервис не учитывает голоса, отданные только за одного кандидата.'),(54,'Выдающиеся личности, ушедшие из жизни','2023-tod-warning.jpg',17,'В данной номинации, посвященной памяти выдающихся личностей, ушедших из жизни, конкурсная комиссия приняла решение о вручении награды родным Эрнста Гербертовича Бооса. Подробнее об известном ученом читайте в описании.\r\n\r\nПожалуйста, голосуйте в каждой представленной номинации! Сервис не учитывает голоса, отданные только за одного кандидата.'),(55,'Номинанты:','kandidaten.jpg',18,'Отдай свой голос за одного из кандидатов!'),(56,'Проверка номинация 1','avangard-2023--business_i3WdCtg.jpg',19,'Кандидаты номинации Проверка номинация 1'),(57,'Проверка номинация 2','avangard-2023-gesellschaft_J0aDwMD.jpg',19,'Кандидаты номинации Проверка номинация 2'),(58,'Проверка номинация 3','avangard-2023-wissenschaft_Lp7YEDK.jpg',19,'Кандидаты номинации Проверка номинация 3');
